// client/src/App.js

import "./App.css";
import React from "react";
import Home from "./Home";
import { Routes ,Route } from 'react-router-dom';



function App() {

  return (

      <Routes>
        <body>
          <Route path='/' element={<Home/>} />
        </body>

      </Routes>

  );
}

export default App;
